    &-scss,
    &-js,
    &-react,
    &-css {
      position: relative;
      margin-right: 2em;
    }
    &-html::before,
    &-scss::before,
    &-css::before,
    &-js::before,
    &-react::before {
      content: '';
      width: 10px;
      height: 10px;
      position: absolute;
      top: 50%;
      left: -15px;
      transform: translateY(-50%);
      border-radius: 100%;
      z-index: 2;
    }
    &-html::before {
      background-color: #e34c26;
    }
    &-scss::before {
      background-color: #c6538c;
    }
    &-css::before {
      background-color: #563d7c;
    }
    &-js::before {
      background-color: #f1e05a;
    }
    &-react::before {
      background-color: #61dbfb;
    }
  }
